import React from 'react'
import { Text, View, StyleSheet, Image } from 'react-native'

const StartImage = () => {
    return (
        <View>
            <Image 
                source={require('../../assets/start-image.png')}
                style={styles.imageStyle}
            />
        </View>
    )
}

const styles = StyleSheet.create({
    imageStyle: {
        height: 400,
        width: 360,
    },
})

export default StartImage
